import React from "react";
// import MyTodoList from "./component/MyTodoList";
import "./App.css";
function App() {
  const TodoLists = ["JS공부하기", "운동하기", "빨래하기"];
  return (
    <div className="app-style">
      {TodoLists.map((TodoListTitle) => {
        return (
          <div className="square-style" key={TodoListTitle}>
            {" "}
            {TodoListTitle}{" "}
          </div>
        );
      })}
    </div>
  );
}

export default App;
